import './index.css';
import Card from './Card';
import data from '../data/data.json';

const Index = () => {
  [cards, setCards] = useState(null);

  return (
    <div className='App'>
      <header>
        <img src='/static/logo.png' className='static-logo' alt='logo' />
      </header>
      <div className='Grid'>
        <Card />
        <Card />
        <Card />
      </div>
    </div>
  );
};

Index.getInitialProps = async () => {
  setCards(data);
  return data;
};

export default Index;
